import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import Home from './Home';

function App() {

  return (
    <div className="App">
      <Navbar bg="dark">
        <Container>
          <Navbar.Brand href="#home">Brand link</Navbar.Brand>
        </Container>
      </Navbar>
      <div className="content">
        <Home /> 
      </div>

    </div>
  );

}

export default App;
